import React from "react";

const Header = () => {
    return(
        <div className="text-center">
            <div>
                <span className='logo'>Recipes</span>
                <ul className='nav'>
                    <li>Рецепты</li>
                    <li></li>
                    <li></li>
                </ul>
            </div>
            <div className='presentation'></div>
        </div>
    )
}

export default Header;
